import { Provider } from "@types/react-redux";
import React from "react";
import ReactDOM from "react-dom";
import "../node_modules/bulma/css/bulma.min.css";
import App from "./App";

ReactDOM.render(
  <Provider>
    <App />
  </Provider>,
  document.getElementById("root")
);
